s;  // camera position\n\nin vec4 fs_Nor;\nin vec4 fs_LightVec;\nin vec4 fs_Col;\nin vec4 fs_Pos;\n\nout vec4 out_Col; \n\nvoid main() {\n    // Material base color (before shading)\n    vec4 diffuseColor = u_Color;\n\n    // Calculate the diffuse term for Lambert shading\n    float diffuseTerm = dot(normalize(fs_Nor), normalize(fs_LightVec));\n    float ambientTerm = 0.2;\n\n    // light vector\n    vec4 L = normalize(fs_LightVec);\n    // view vector\n    vec4 V = normalize(vec4((u_CamPos - fs_Pos.xyz), 0.0));\n    // vector between the view and light vector\n    vec4 H = normalize((V + L) / 2.0);\n    // normal vector\n    vec4 N = normalize(fs_Nor);\n\n    float specularTerm = max(pow(dot(H, N), SHININESS), 0.0) * 0.5;\n\n    float lightIntensity = diffuseTerm + ambientTerm + specularTerm;  \n    // Compute final shaded color\n    out_Col = vec4(diffuseColor.rgb * lightIntensity, diffuseColor.a);\n}\n"},6029:e=>{e.exports="#version 300 es\n\n#define BUMPINESS 0.1\n#define FREQ 4.0\n#define EPSILON 0.1\n\nuniform mat4 u_Model;       // The matrix that defines the transformation of the\n                            // object we're rendering\n\nuniform mat4 u_ModelInvTr;  // The inverse transpose of the model matrix.\n                            // This allows us to transform the object's normals properly\n                            // if the object has been non-uniformly scaled.\n\nuniform mat4 u_ViewProj;    // The matrix that defines the camera's transformation\n\nin vec4 vs_Pos;             // The array of vertex positions passed to the shader\nin vec4 vs_Nor;             // The array of vertex normals passed to the shader\nin vec4 vs_Col;             // The array of vertex colors passed to the shader\n\nout vec4 fs_Nor;            // The array of normals that has been transformed by u_ModelInvTr\nout vec4 fs_LightVec;       // The direction in which our virtual light lies, relative to each vertex\nout vec4 fs_Col;            // The color of each vertex\nout vec4 fs_Pos;            // The position of each vertex\n\nconst vec4 lightPos = vec4(5, 5, 3, 1); \n\nfloat f(vec3 pos);      // returns the amount to offset the vertex position\nvec4 calcNor(vec3 nor);\n\nvoid main() {\n    // offset the vertex position by the bump map as defined by perlin noise\n    vec4 modelposition = vs_Pos + f(vs_Pos.xyz) * vs_Nor;\n    modelposition = u_Model * modelposition;\n    fs_Pos = modelposition;\n\n    // compute the new normal of the vertex\n    mat3 invTranspose = mat3(u_ModelInvTr);\n    fs_Nor = calcNor(invTranspose * vec3(vs_Nor));\n\n    // pass on data to be interpolated and passed on to frag shader\n    fs_Col = vs_Col;\n    fs_LightVec = lightPos - modelposition; \n\n    gl_Position = u_ViewProj * modelposition;\n}\n\n/********** noise function definitions **********/\n\nfloat surflet(vec3 P, vec3 Gp_ijk);\n\nfloat perlinNoise(vec3 P, float samplingFreq) {\n    P = P * samplingFreq;\n    \n    float sum = 0.f;\n    vec3 Gp = floor(P);\n    \n    for (int x = 0; x <= 1; x++) {\n        for (int y = 0; y <= 1; y++) {\n            for (int z = 0; z <= 1; z++) {\n                sum += surflet(P, Gp + vec3(x, y, z));\n            }\n        }\n    }\n    \n    return sum;\n}\n\n/********** helper function definitions **********/\n\nfloat f(vec3 pos) {\n    return BUMPINESS * perlinNoise(pos.xyz, FREQ);\n}\n\n// computes the normal as defined here\n// https://developer.download.nvidia.com/books/HTML/gpugems/gpugems_ch05.html\nvec4 calcNor(vec3 nor) {\n    float F_0 = f(vs_Pos.xyz);\n    float F_x = f(vs_Pos.xyz + vec3(EPSILON, 0, 0));\n    float F_y = f(vs_Pos.xyz + vec3(0, EPSILON, 0));\n    float F_z = f(vs_Pos.xyz + vec3(0, 0, EPSILON));\n\n    vec3 dF = (vec3(F_x, F_y, F_z) - vec3(F_0)) / EPSILON;\n\n    return vec4(normalize(nor - dF), 0);\n}\n\nvec3 random3(vec3 p) {\n    return fract(sin(vec3(dot(p, vec3(127.1f, 311.7f, 420.69f)),\n                          dot(p, vec3(269.5f, 183.3f, 632.897f)),\n                          dot(p - vec3(5.555, 10.95645, 70.266), vec3(765.54f, 631.2f, 109.21f)))) * 43758.5453f);\n}\n\nfloat fade(float t) {\n    return t * t * t * ( t * (6.f*t - 15.f) + 10.f );\n}\n\nfloat surflet(vec3 P, vec3 Gp_ijk) {\n    // Get the vector from the grid point to P\n    vec3 diff = P - Gp_ijk;\n    \n    float tX = 1.f - fade(abs(diff.x));\n    float tY = 1.f - fade(abs(diff.y));\n    float tZ = 1.f - fade(abs(diff.z));\n    \n    // Get the random vector for the grid point\n    vec3 gradient = random3(Gp_ijk);\n    \n    \n    // Get the noise contribution from this grid point\n    float n_ijk = dot(diff, gradient);\n    \n    // Get the interpolated noise contribution frmo this grid point\n    return n_ijk * tX * tY * tZ;\n}\n"},9065:e=>{e.exports="#version 300 es\n\n// This is a fragment shader. If you've opened this file first, please\n// open and read lambert.vert.glsl before reading on.\n// Unlike the vertex shader, the fragment shader actually does compute\n// the shading of geometry. For every pixel in your program's output\n// screen, the fragment shader is run for every bit of geometry that\n// particular pixel overlaps. By implicitly interpolating the position\n// data passed into the fragment shader by the vertex shader, the fragment shader\n// can compute what color to apply to its pixel based on things like vertex\n// position, light position, and vertex color.\nprecision highp float;\n\nuniform vec4 u_Color; // The color with which to render this instance of geometry.\n\nuniform int u_FragTime;\n\nuniform int u_Octaves;  // The number of octaves to compute for fractal noise\nuniform vec2 u_Fractal; // The starting frequency and the persistence for fractal noise\n\n// These are the interpolated values out of the rasterizer, so you can't know\n// their specific values without knowing the vertices that contributed to them\nin vec4 fs_Nor;\nin vec4 fs_LightVec;\nin vec4 fs_Col;\nin vec4 fs_Pos;\n\nout vec4 out_Col; // This is the final output color that you will see on your\n                  // screen for the pixel that is currently being processed.\n\n\nvec2 random2(vec3 p) {\n    return fract(sin(vec2(dot(p, vec3(127.1f, 311.7f, 420.69f)),\n                          dot(p, vec3(269.5f, 183.3f, 632.897f)))) * 43758.5453f);\n}\n\nfloat random1(vec2 p) {\n    return fract(sin(dot(p, vec2(420.6f, 631.2f)))*43758.5453f);\n}\n\nfloat random1(vec3 p) {\n    return random1(random2(p));\n}\n\nfloat smoothStep(float a, float b, float t) {\n    t = t * t * t * ( t * (6.f*t - 15.f) + 10.f );\n    return mix(a, b, t);\n}\n\nfloat brownianMotion(vec3 P, float samplingFreq) {\n    P = P * samplingFreq;\n\n    // tilespace coords\n    vec3 uvw = fract(P);\n    vec3 Gp = floor(P);\n\n    // grid points\n    vec3 Gp000 = Gp;\n    vec3 Gp100 = Gp + vec3(1,0,0);\n    \n    vec3 Gp010 = Gp + vec3(0,1,0);\n    vec3 Gp110 = Gp + vec3(1,1,0);\n\n    vec3 Gp001 = Gp + vec3(0,0,1);\n    vec3 Gp101 = Gp + vec3(1,0,1);\n\n    vec3 Gp011 = Gp + vec3(0,1,1);\n    vec3 Gp111 = Gp + vec3(1,1,1);\n\n    // noise contribution from each grid point\n    float n000 = random1(Gp000);\n    float n100 = random1(Gp100);\n\n    float n010 = random1(Gp010);\n    float n110 = random1(Gp110);\n\n    float n001 = random1(Gp001);\n    float n101 = random1(Gp101);\n\n    float n011 = random1(Gp011);\n    float n111 = random1(Gp111);\n    \n\n    // Interpolate along x the contributions from each of the corners\n    float nx00 = smoothStep(n000, n100, uvw.x);\n    float nx10 = smoothStep(n010, n110, uvw.x);\n    float nx01 = smoothStep(n001, n101, uvw.x);\n    float nx11 = smoothStep(n011, n111, uvw.x);\n    \n    // Interpolate the four results along y\n    float nxy0 = smoothStep(nx00, nx10, uvw.y);\n    float nxy1 = smoothStep(nx01, nx11, uvw.y);\n    \n    // Interpolate the two last results along z\n    float nxyz = smoothStep(nxy0, nxy1, uvw.z);\n\n    return nxyz;\n}\n\n// fractal brownian motion\nfloat fbm(vec3 P, int octaves) {\n    float amp = 0.5;\n    float freq = u_Fractal.x;\n    float sum = 0.0;\n\n    for (int i = 0; i < octaves; i++) {\n        sum += brownianMotion(P, freq) * amp;\n        amp *= u_Fractal.y;\n        freq *= 2.0;\n    }\n\n    return sum + 0.25 + pow(0.25, float(octaves));\n}\n\nvoid main() {\n    float time = float(u_FragTime) * 0.003;\n    vec3 P = vec3(fs_Pos.xy, fs_Pos.z + time);\n\n    float amount = fbm(P, u_Octaves);\n    vec3 diffuseColor = mix(vec3(0), u_Color.rgb, amount);\n\n    // Calculate the diffuse term for Lambert shading\n    float diffuseTerm = dot(normalize(fs_Nor), normalize(fs_LightVec));\n    // Avoid negative lighting values\n    // diffuseTerm = clamp(diffuseTerm, 0, 1);\n\n    float ambientTerm = 0.2;\n\n    float lightIntensity = diffuseTerm + ambientTerm;   //Add a small float value to the color multiplier\n                                                            //to simulate ambient lighting. This ensures that faces that are not\n                                                            //lit by our point light are not completely black.\n\n    // Compute final shaded color\n    out_Col = vec4(diffuseColor * lightIntensity, 1);\n}\n"},7063:e=>{e.exports="#version 300 es\n\n// This is a fragment shader. If you've opened this file first, please\n// open and read lambert.vert.glsl before reading on.\n// Unlike the vertex shader, the fragment shader actually does compute\n// the shading of geometry. For every pixel in your program's output\n// screen, the fragment shader is run for every bit of geometry that\n// particular pixel overlaps. By implicitly interpolating the position\n// data passed into the fragment shader by the vertex shader, the fragment shader\n// can compute what color to apply to its pixel based on things like vertex\n// position, light position, and vertex color.\nprecision highp float;\n\nuniform vec4 u_Color; // The color with which to render this instance of geometry.\n\n// These are the interpolated values out of the rasterizer, so you c